import BatsmenItem from './BatsmenItem';

function BatsmenBox(props) {
    return (
        <div id='batsmen_box'>
            {props.batsmen.map((batsman, index) => (
            <BatsmenItem key={index} name={batsman[0]} runs={batsman[1]} balls={batsman[2]} notout={batsman[3]} team={props.team}/>
            ))}
        </div>
        );

    }
